import "./App.css";
import * as React from "react";
import Avatar from "@mui/material/Avatar";
import Stack from "@mui/material/Stack";
import { deepOrange } from "@mui/material/colors";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemText from "@mui/material/ListItemText";
import Divider from "@mui/material/Divider";
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function App() {
  return (
    <div className="App">
      <ImageAvatars />
      <InformacaoPessoal />
    </div>
  );
}

function ImageAvatars() {
  return (
    <div className="Avatar">
      <Stack direction="row" spacing={2}>
        <Avatar
          alt="Remy Sharp"
          src="/static/images/avatar/1.jpg"
          sx={{ bgcolor: deepOrange[500], width: 70, height: 70 }}
        />
      </Stack>
    </div>
  );
}

function InformacaoPessoal() {
  return (
    <div className="InformacaoPessoal">
      <List
        sx={{
          width: "100%",
          maxWidth: 500,
          bgcolor: "background.paper",
        }}
      >
        <Divider variant="inset">Informações Pessoais</Divider>
        <ListItem>
          <ListItemText
            primary="Nome"
            secondary="Ayron Brhenno Silva Figueiredo"
          />
        </ListItem>
        <Divider variant="inset" component="li" />
        <ListItem>
          <ListItemText primary="Email" secondary="ayronbrhennoo@gmail.com" />
        </ListItem>
        <Divider variant="inset" component="li" />
        <ListItem>
          <ListItemText primary="Telefone" secondary="66 99967-5618" />
        </ListItem>
      </List>
    </div>
  );
}

function CriarData(atividade, dataDeInicio, dataDeFinalizacao) {
  return { atividade, dataDeInicio, dataDeFinalizacao };
}

const rows = [
  CriarData("Entregar relátorio", "2023-03-16", "2023-03-25"),
  CriarData("Corrigir bug", "2023-05-14", "2023-05-15"),
  CriarData("Enviar convite", "2023-07-01", "2023-07-05"),
  CriarData("Reunião de equipe", "2023-07-10", "2023-07-11"),
  CriarData("Preparar apresentação", "2023-07-15", "2023-07-20"),
  CriarData("Realizar testes", "2023-07-25", "2023-07-28"),
  CriarData("Atualizar documentação", "2023-08-02", "2023-08-05"),
  CriarData("Treinamento de novos funcionários", "2023-08-10", "2023-08-12"),
  CriarData("Finalizar projeto", "2023-08-15", "2023-08-20"),
];

function TabelaAtividades() {
  <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Atividades</TableCell>
            <TableCell align="right">Data de inicio</TableCell>
            <TableCell align="right">Data de finalização&nbsp;</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.dataDeInicio}</TableCell>
              <TableCell align="right">{row.dataDeFinalizacao}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
}

export default App;
